55);\">});</li><li style=\"margin: 0px 0px 0px 45px; padding: 0px 5px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); list-style-type: decimal-leading-zero; box-sizing: content-box; position: relative; line-height: 20px; border-left: 1px solid rgb(226, 226, 226); background-color: rgb(255, 255, 255);\">      </li></ol></pre><blockquote class=\"layui-elem-quote layui-quote-nm\" style=\"margin-bottom: 10px; padding: 15px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); line-height: 22px; border-top: 1px solid rgb(230, 230, 230); border-right: 1px solid rgb(230, 230, 230); border-bottom: 1px solid rgb(230, 230, 230); border-left-color: rgb(230, 230, 230); border-radius: 0px 2px 2px 0px; background: 0px 0px; color: rgb(255, 87, 34);\">注意：该参数为 layui 2.3.0 新增。</blockquote></div><fieldset class=\"layui-elem-field layui-field-title site-title\" style=\"margin-top: 30px; margin-bottom: 20px; border-top: 1px solid rgb(230, 230, 230); border-right-style: solid; border-bottom-style: solid; border-left-style: solid; border-right-color: rgb(230, 230, 230); border-bottom-color: rgb(230, 230, 230); border-left-color: rgb(230, 230, 230); font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, Tahoma, Arial, sans-serif; font-size: 14px;\"><legend style=\"margin-left: 20px; padding-right: 10px; padding-left: 10px; font-size: 20px;\"><a name=\"minmax\" style=\"color: rgb(51, 51, 51);\">min/max - 最小/大范围内的日期时间值</a></legend></fieldset><div class=\"site-text\" style=\"margin: 0px; padding: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); position: relative; font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, Tahoma, Arial, sans-serif; font-size: 14px;\"><p style=\"padding: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); line-height: 22px;\">类型：<em style=\"padding: 0px 3px; color: rgb(102, 102, 102);\">string</em>，默认值：<em style=\"padding: 0px 3px; color: rgb(102, 102, 102);\">min: \'1900-1-1\'</em>、<em style=\"padding: 0px 3px; color: rgb(102, 102, 102);\">max: \'2099-12-31\'</em></p><p style=\"padding: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); line-height: 22px;\">设定有限范围内的日期或时间值，<em style=\"padding: 0px 3px; color: rgb(102, 102, 102);\">不在范围内的将不可选中</em>。这两个参数的赋值非常灵活，主要有以下几种情况：</p><table class=\"layui-table\" style=\"margin: 10px 0px; width: 898px; background-color: rgb(255, 255, 255); color: rgb(102, 102, 102);\"><tbody><tr style=\"transition: all 0.3s ease 0s;\"><td style=\"margin: 0px; padding: 9px 15px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); border-width: 1px; border-style: solid; border-color: rgb(230, 230, 230); position: relative; min-height: 20px; line-height: 20px;\">1.</td><td style=\"margin: 0px; padding: 9px 15px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); border-width: 1px; border-style: solid; border-color: rgb(230, 230, 230); position: relative; min-height: 20px; line-height: 20px;\">如果值为字符类型，则：<em style=\"padding: 0px 3px;\">年月日必须用 -（中划线）分割</em>、<em style=\"padding: 0px 3px;\">时分秒必须用 :（半角冒号）号分割</em>。这里并非遵循 format 设定的格式</td></tr><tr style=\"transition: all 0.3s ease 0s;\"><td style=\"margin: 0px; padding: 9px 15px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); border-width: 1px; border-style: solid; border-color: rgb(230, 230, 230); position: relative; min-height: 20px; line-height: 20px;\">2.</td><td style=\"margin: 0px; padding: 9px 15px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); border-width: 1px; border-style: solid; border-color: rgb(230, 230, 230); position: relative; min-height: 20px; line-height: 20px;\">如果值为整数类型，且数字＜86400000，则数字代表天数，如：min: -7，即代表最小日期在7天前，正数代表若干天后</td></tr><tr style=\"transition: all 0.3s ease 0s;\"><td style=\"margin: 0px; padding: 9px 15px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); border-width: 1px; border-style: solid; border-color: rgb(230, 230, 230); position: relative; min-height: 20px; line-height: 20px;\">3.</td><td style=\"margin: 0px; padding: 9px 15px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); border-width: 1px; border-style: solid; border-color: rgb(230, 230, 230); position: relative; min-height: 20px; line-height: 20px;\">如果值为整数类型，且数字 ≥ 86400000，则数字代表时间戳，如：max: 4073558400000，即代表最大日期在：公元3000年1月1日</td></tr></tbody></table><pre class=\"layui-code layui-box layui-code-view\" lay-title=\"示例\" style=\"margin-top: 10px; padding: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); box-sizing: content-box; position: relative; line-height: 20px; border-left-width: 6px; border-color: rgb(226, 226, 226); background-color: rgb(242, 242, 242); font-family: &quot;Courier New&quot;; font-size: 12px;\"><h3 class=\"layui-code-h3\" style=\"margin: 0px; padding: 0px 10px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); font-size: 12px; box-sizing: content-box; position: relative; height: 32px; line-height: 32px; border-bottom: 1px solid rgb(226, 226, 226);\">示例<a href=\"http://www.layui.com/doc/modules/code.html\" target=\"_blank\" style=\"color: rgb(153, 153, 153); box-sizing: content-box; position: absolute; right: 10px; top: 0px;\">layui.code</a></h3><ol class=\"layui-code-ol\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); box-sizing: content-box; position: relative; overflow: auto;\"><li style=\"margin: 0px 0px 0px 45px; padding: 0px 5px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); list-style-type: decimal-leading-zero; box-sizing: content-box; position: relative; line-height: 20px; border-left: 1px solid rgb(226, 226, 226); background-color: rgb(255, 255, 255);\">//日期有效范围只限定在：2017年</li><li style=\"margin: 0px 0px 0px 45px; padding: 0px 5px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); list-style-type: decimal-leading-zero; box-sizing: content-box; position: relative; line-height: 20px; border-left: 1px solid rgb(226, 226, 226); background-color: rgb(255, 255, 255);\">laydate.render({ </li><li style=\"margin: 0px 0px 0px 45px; padding: 0px 5px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); list-style-type: decimal-leading-zero; box-sizing: content-box; position: relative; line-height: 20px; border-left: 1px solid rgb(226, 226, 226); background-color: rgb(255, 255, 255);\">  elem: \'#test\'</li><li style=\"margin: 0px 0px 0px 45px; padding: 0px 5px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); list-style-type: decimal-leading-zero; box-sizing: content-box; position: relative; line-height: 20px; border-left: 1px solid rgb(226, 226, 226); background-color: rgb(255, 255, 255);\">  ,min: \'2017-1-1\'</li><li style=\"margin: 0px 0px 0px 45px; padding: 0px 5px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); list-style-type: decimal-leading-zero; box-sizing: content-box; position: relative; line-height: 20px; border-left: 1px solid rgb(226, 226, 226); background-color: rgb(255, 255, 255);\">  ,max: \'2017-12-31\'</li></ol></pre></div>', 'admin', '2019-07-24 19:05:42', 'admin', '2019-07-24 19:06:11');
