DROP TABLE IF EXISTS `day_register_statistics`;
CREATE TABLE `day_register_statistics` (
  `happen_date` date NOT NULL COMMENT '发生日期',
  `reg_total` int(8) NOT NULL COMMENT '注册总人数',
  `member_total` int(8) NOT NULL COMMENT '注册会员总人数',
  `agent_total` int(6) NOT NULL COMMENT '申请代理总人数',
  `c_fst_rec_total` int(6) DEFAULT '0' COMMENT '注册当天首充人数',
  `c_sec_rec_total` int(6) DEFAULT '0' COMMENT '注册当天二充人数',
  `h_fst_rec_total` int(6) DEFAULT '0' COMMENT '历史注册当天首充人数',
  `h_sec_rec_total` int(6) DEFAULT '0' COMMENT '历史注册当天二充人数',
  `c_reg_rec_times` int(6) DEFAULT '0' COMMENT '注册当天充值次数',
  `c_reg_rec_amount` decimal(15,4) DEFAULT '0.0000' COMMENT '注册当天充值金额',
  `h_fst_rec_amount` decimal(15,4) DEFAULT '0.0000' COMMENT '历史注册当天首充金额',
  `h_rec_amount` decimal(15,4) DEFAULT '0.0000' COMMENT '历史注册当天充值金额',
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`happen_date`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='每日注册统计';

