-- ----------------------------
DROP TABLE IF EXISTS `finance_account_change`;
CREATE TABLE `finance_account_change` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `user_id` bigint(20) NOT NULL COMMENT '用户id',
  `user_login_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '用户登录账号',
  `user_name` varchar(50) DEFAULT NULL COMMENT '用户名称',
  `change` decimal(15,2) NOT NULL COMMENT '变动金额',
  `change_before` decimal(15,2) NOT NULL COMMENT '变动前金额',
  `change_after` decimal(15,2) DEFAULT NULL COMMENT '变动后金额',
  `change_type` tinyint(2) NOT NULL DEFAULT '0' COMMENT '变动类型 0：线上充值 1：线下充值 2：提款扣款 3：提款失败返还 4：下注 5：撤单 6：未开奖回滚 7：派错奖回滚 8：派奖 9：首充赠送 10：活动赠送 11：注册赠送 12:手动加款  13：手动扣款',
  `change_status` tinyint(2) DEFAULT NULL COMMENT '状态 0：成功 1：失败 2：冻结',
  `relation_id` bigint(20) DEFAULT NULL COMMENT '关联的id',
  `order_number` varchar(32) DEFAULT NULL COMMENT '关联的订单编号',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_by` varchar(50) DEFAULT NULL COMMENT '操作人',
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `user_remark` varchar(500) DEFAULT NULL COMMENT '会员备注',
  `remark` varchar(500) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`),
  KEY `CHANGE_USER_INDEX` (`user_id`) USING BTREE COMMENT '用户id索引',
  KEY `CHANGE_ORDER_INDEX` (`order_number`) USING BTREE COMMENT '订单id索引'
) ENGINE=InnoDB AUTO_INCREMENT=10635 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='会员账变记录';

