  `is_first` tinyint(2) NOT NULL DEFAULT '0' COMMENT '是否首充，0否 1是',
  `agent_id` bigint(20) DEFAULT NULL COMMENT '代理id',
  `agent_name` varchar(50) DEFAULT NULL COMMENT '代理名称',
