  `pay_type` tinyint(2) NOT NULL DEFAULT '0' COMMENT '支付方式 0：支付宝 1：微信 2：银行卡 3:其他',
  `type` tinyint(2) NOT NULL DEFAULT '0' COMMENT '类型 0：线上充值 1：线下充值  2:注册赠送 3.首充赠送\r\n4.充值赠送',
  `status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '状态 0：待支付 1：支付成功 2：支付失败 3：验签失败',
  `is_locking` tinyint(2) NOT NULL DEFAULT '0' COMMENT '是否锁定 0：锁定 1：操作完成 2：锁定失败',
  `is_refund` tinyint(2) DEFAULT NULL COMMENT '是否需要退款 0：不需要 1：需要 2：已退款',
  `create_by` varchar(50) DEFAULT NULL COMMENT '操作人',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_by` varchar(50) DEFAULT NULL COMMENT '操作人',
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `remark` varchar(500) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`),
  KEY `SERIAL_NUMBER_INDEX` (`serial_number`) USING BTREE COMMENT '流水订单号索引',
  KEY `SERIAL_USER_INDEX` (`user_id`) USING BTREE COMMENT '用户id索引'
) ENGINE=InnoDB AUTO_INCREMENT=10259 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='会员充值记录';

