-- ----------------------------
-- Table structure for user_account_statistics
-- ----------------------------
DROP TABLE IF EXISTS `user_account_statistics`;
CREATE TABLE `user_account_statistics` (
  `user_id` bigint(20) NOT NULL COMMENT '用户id,对应T_User.ID',
  `online_deposit` decimal(10,4) NOT NULL DEFAULT '0.0000' COMMENT '在线存款额',
  `artificial_deposit` decimal(10,4) NOT NULL DEFAULT '0.0000' COMMENT '人工存款额',
  `artificial_confirm` decimal(10,4) NOT NULL DEFAULT '0.0000' COMMENT '人工确认充值额',
  `online_cash` decimal(10,4) NOT NULL DEFAULT '0.0000' COMMENT '在线提款额',
  `artificial_cash` decimal(10,4) NOT NULL DEFAULT '0.0000' COMMENT '人工提款额',
  `last_deposit_amount` decimal(10,4) NOT NULL DEFAULT '0.0000' COMMENT '当日最后存款金额',
  `last_cash_amount` decimal(10,4) NOT NULL DEFAULT '0.0000' COMMENT '当日最后提款金额',
  `last_deposit_remark` varchar(100) DEFAULT '' COMMENT '当日最后充值简介',
  `last_cash_remark` varchar(100) DEFAULT '' COMMENT '当日最后提款简介',
  `last_deposit_time` datetime DEFAULT NULL COMMENT '当日最后充值时间',
  `last_cash_time` datetime DEFAULT NULL COMMENT '当日最后提款时间',
  `deposit_numbers` int(5) NOT NULL DEFAULT '0' COMMENT '当日存款次数',
  `cash_numbers` int(5) NOT NULL DEFAULT '0' COMMENT '当日提款次数',
  `deposit_give` decimal(15,4) NOT NULL DEFAULT '0.0000' COMMENT '存款获赠额',
  `regist_give` decimal(15,4) NOT NULL DEFAULT '0.0000' COMMENT '注册获赠额',
  `activity_prize` decimal(15,4) NOT NULL DEFAULT '0.0000' COMMENT '活动中奖额',
  `cp_refund` decimal(15,4) NOT NULL DEFAULT '0.0000' COMMENT 'CP返水额',
  `cp_rebates` decimal(15,4) NOT NULL DEFAULT '0.0000' COMMENT 'CP返点额',
  `lh_refund` decimal(15,4) NOT NULL DEFAULT '0.0000' COMMENT 'LH返水额',
  `lh_rebates` decimal(15,4) NOT NULL DEFAULT '0.0000' COMMENT 'LH返点额',
  `jc_refund` decimal(15,4) NOT NULL DEFAULT '0.0000' COMMENT 'JC返水额',
  `jc_rebates` decimal(15,4) NOT NULL DEFAULT '0.0000' COMMENT 'JC返点额',
  `cp_bat_amount` decimal(15,4) NOT NULL DEFAULT '0.0000' COMMENT '彩票投注额',
  `lh_bat_amount` decimal(15,4) NOT NULL DEFAULT '0.0000' COMMENT '六合投注额',
  `jc_bat_amount` decimal(15,4) NOT NULL DEFAULT '0.0000' COMMENT '竞彩投注额',
  `cp_prize_amount` decimal(15,4) NOT NULL DEFAULT '0.0000' COMMENT '彩票派奖额',
  `lh_prize_amount` decimal(15,4) NOT NULL DEFAULT '0.0000' COMMENT '六合派奖额',
  `jc_prize_amount` decimal(15,4) NOT NULL DEFAULT '0.0000' COMMENT '竞彩派奖额',
  `cp_gain_loss` decimal(15,4) NOT NULL DEFAULT '0.0000' COMMENT '彩票盈亏',
  `lh_gain_loss` decimal(15,4) NOT NULL DEFAULT '0.0000' COMMENT '六合盈亏',
  `jc_gain_loss` decimal(15,4) NOT NULL DEFAULT '0.0000' COMMENT 'JC盈亏',
  `cp_bat_times` int(4) NOT NULL DEFAULT '0' COMMENT '彩票投注次数',
  `lh_bat_times` int(4) NOT NULL DEFAULT '0' COMMENT '六合投注次数',
  `jc_bat_times` int(4) NOT NULL DEFAULT '0' COMMENT 'JC投注次数',
  `cp_win_times` int(4) NOT NULL DEFAULT '0' COMMENT 'CP中奖次数',
  `lh_win_times` int(4) NOT NULL DEFAULT '0' COMMENT '六合中奖次数',
  `jc_win_times` int(4) NOT NULL DEFAULT '0' COMMENT 'JC中奖次数',
  `happen_time` date NOT NULL COMMENT '数据发生时间',
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`user_id`,`happen_time`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='会员数据统计';

-- ----------------------------
-- Records of user_account_statistics
-- ----------------------------

-- ----------------------------
-- Table structure for user_base_statistics
-- ----------------------------
DROP TABLE IF EXISTS `user_base_statistics`;
CREATE TABLE `user_base_statistics` (
  `user_id` bigint(20) NOT NULL COMMENT '用户id,对应T_User.ID',
  `user_name` varchar(50) NOT NULL COMMENT '用户名,对应T_User.Name',
  `nick_name` varchar(50) DEFAULT '' COMMENT '昵称,对应T_User.NickName',
  `head_img` varchar(300) DEFAULT '' COMMENT '昵称,对应T_User.FaceUrl',
  `belong_agent` bigint(20) DEFAULT '0' COMMENT '所属代理',
  `first_agent` bigint(20) DEFAULT '0' COMMENT '一级代理',
  `agent_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '代理用户名,对应T_User.Name',
  `first_agent_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '一级代理用户名,对应T_User.Name',
  `mobile` varchar(12) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '手机,对应T_User.mobile',
  `regist_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '注册时间',
  `balance` decimal(18,4) NOT NULL DEFAULT '0.0000' COMMENT '余额',
  `current_purchases` decimal(15,4) NOT NULL DEFAULT '0.0000' COMMENT '当前打码量',
  `need_purchases` decimal(15,4) NOT NULL DEFAULT '0.0000' COMMENT '提款所需打码量',
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `no_login_length` double(5,1) NOT NULL DEFAULT '0.0' COMMENT '未登录天数',
  `reg_ip` varchar(20) NOT NULL DEFAULT '0.0.0.0' COMMENT '注册IP',
  `last_login_ip` varchar(20) NOT NULL DEFAULT '0.0.0.0' COMMENT '最后登录IP',
  `last_login_time` datetime DEFAULT NULL COMMENT '最后登录时间',
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='用户基本信息表';

-- ----------------------------
-- Records of user_base_statistics
-- ----------------------------
